// temp mock data
const stationData = [
  {
    id: 1,
    name: "8 St - NYU",
    lines: ["R", "W"],
  },
  {
    id: 2,
    name: "West 4 St - Washington Square",
    lines: ["A", "C"],
  },
  {
    id: 3,
    name: "14 St - Union Square",
    lines: ["R", "W", "L", "6"],
  },
  {
    id: 4,
    name: "Astor Pl",
    lines: ["4", "5", "6"],
  },
  {
    id: 5,
    name: "Times Square - 42 St",
    lines: ["A", "C", "E", "N"], // a lot more in reality
  },
  {
    id: 6,
    name: "Lorem Ispum Dolor Sit Amet",
    lines: ["A", "B", "C", "1", "2", "3"],
  },
  {
    id: 7,
    name: "The Final Destination",
    lines: ["A", "B", "C", "1", "2", "3"],
  },
];

export default stationData;
